import { Box } from '@mui/material';
import {MealDetails} from './components/' 


function App() {
  return (
    <Box className="main" sx={{display:'flex',width:'80%',margin:'auto'}}>
      <MealDetails name="Breakfast"/>
      <MealDetails name="Lunch"/>
      <MealDetails name="Dinner"/>
      <MealDetails name="Snacks"/>
    </Box>
  );
}

export default App;
